import React from 'react';
import '../css/Footer.css'; // Link the CSS for footer

function Footer() {
  return (
    <footer>
      <p>AJS & Matchless Owners Club Ltd.<br />
        Unit 3, Robinson Way, Telford Way Ind. Estate,<br />
        Kettering, Northants, NN16 8PT, England.<br />
        Company No.: 04715137 | VAT No.: 380 1297 60 | EORI No.: GB380129760000<br />
        Phone: +44 (0)1536 511532</p>
    </footer>
  );
}

export default Footer;
